import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import IconButton from '@material-ui/core/IconButton';
import Typography from '@material-ui/core/Typography';
import AutoComplete from './AutoComplete.js';

const styles = theme => ({
  card: {
    display: '',
    width: 1000,
    margin:25,
    height: 300,
  },
  details: {
    display: 'flex',
    flexDirection: '',
  },
  content: {
    flex: '',
  },
  cover: {
    width: 10,
  },
  controls: {
    display: 'flex',
    alignItems: 'center',
    paddingLeft: theme.spacing.unit,
    paddingBottom: theme.spacing.unit,
  },
});

class CardCase5 extends React.Component {
  constructor(props){
    super(props)
    this.state = {
      value : null,
    }
  }

  onSubmit = (value) => {
    this.setState({value})
  }

  onSubmitUrl = (value2) => {
    this.setState({value2})
  }


  render(){
  const { classes, theme } = this.props;

  return (
    <Card className={classes.card}>
      <div className={classes.details}>
        <CardContent className={classes.content}>
        <Typography component="h5" variant="h5">
            Case Description
        </Typography>
        <Typography component="h15" variant="h15">
          <div className="container_6">
              <p>Subject</p>
              <AutoComplete onSubmit = {this.onSubmit} foo = {this.state.value1} onSubmitUrl={this.onSubmitUrl}/>
              <div className="container_3">
              <p>Description</p>
              <textarea placeholder="Detailed account of the question or issue" id="textbox" ></textarea>
              </div>
            </div>
        </Typography>
        <Typography component="h15" variant="h15">
          <div className="container_2">
            <h1>Suggestions</h1>
            <div className="container_4">
              <h1>Results</h1>
              <p>{this.state.value}</p>
              <h1>Url:</h1>
              <p><a href={this.state.value2}>{this.state.value2}</a></p>
            </div>
          </div>
        </Typography>
        </CardContent>
      </div>
    </Card>
  );
  }
}

CardCase5.propTypes = {
  classes: PropTypes.object.isRequired,
  theme: PropTypes.object.isRequired,
};

export default withStyles(styles, { withTheme: true })(CardCase5);
